INSERT INTO `assistencias` VALUES ('17', '21', '1', '21', '3', '2012-07-03 07:53:44', '2012-07-09 09:38:58', '2012-07-09 10:05:23', 'concluido', 'Possui carteira de isenção tarifária em razão de ordem judicial.\nNão foi renovada.\nExpedido ofício para agetran.\ntelefone contato - 91100073 (emerson), 92763413 (arlete), 33066674 (osvaldo).\nAguardando resposta ofício. Informa que ficará fora da cidade até o fim de julho/2012.', 'sim', '012', '3');
INSERT INTO `assistencias` VALUES ('18', '20', '1', '5', '5', '2012-07-03 07:54:18', '2012-07-03 07:54:18', '2012-07-03 09:10:15', 'concluido', 'Cirurgia braço esquerdo. Microcirurgia de plexo braquial com microenxertia. Acidente moto outubro/2011. Fez tratamento fisioterápico, sem resultado satisfatório. Encaminhamento para cirurgia dia 25.06.12. Prazo máximo de cinco meses, caso contrário pode perder os movimentos do braço. Ofício 18 - SESAU. Trazer laudo médico e da fisioterapeuta, em caso de ação. ', 'nao', '614', '5');
INSERT INTO `assistencias` VALUES ('19', '19', '1', '21', '9', '2012-07-03 07:54:18', '2012-07-03 07:54:18', '2012-07-03 14:11:37', 'concluido', 'ação cidadania - FRALDAS - ag documentos', 'nao', '038', '9');
