INSERT INTO `assistencias` VALUES ('21', '17', '2', '5', '27', '2012-07-03 07:55:36', '2012-07-03 07:55:36', '2012-07-03 08:30:33', 'concluido', 'Em 03/07/12 - Informei julgamento de agravo no TJ para data de hj, às 14 hs. O andamento do cumprimento de sentença que tem publicação no DJ para adequação do prazo prescricional e de outro agravo recebido para o STJ, aguardando julgar.', 'sim', '035', '27');
