INSERT INTO `assistencias` VALUES ('23', '24', '20', '48', '9', '2012-07-03 07:58:39', '2012-07-03 07:58:39', '2012-07-03 14:21:30', 'concluido', 'ainda não foi citado, mas ficou sabendo da ação. foi orientado a aguardar penhora para posterior manifestação. tem um acordo com a prefeitura para compensação de valores, pedi vista do processo de 2010 para verificar e solicitar a baixa junto aos cadastros da prefeitura.', 'nao', '615', '9');
INSERT INTO `assistencias` VALUES ('24', '27', '1', '5', '39', '2012-07-03 08:00:10', '2012-07-03 08:00:10', '2012-07-03 08:41:18', 'concluido', '-Ação nova contra a Santa Cecília empreendimentos Imobiliários Ltda, que indevidamente inscreveu seu nome nos cadastros do SPC/SERASA, em decorrência de \"inadimplemento contra a Haspa\". ag. docs para ajuizar ação.', 'nao', '426', '39');
