INSERT INTO `assistencias` VALUES ('26', '28', '7', '6', '17', '2012-07-03 08:00:29', '2012-07-10 07:17:30', '2012-07-10 09:00:36', 'concluido', 'Processo: 0037033-94.2012.8.12.0001\r\n05/07/2012 - Adjudicação de 1 moto para único herdeiro\r\n10/07/2012 - Não quer dar prosseguimento a ação', 'nao', '892', '18');
INSERT INTO `assistencias` VALUES ('27', '26', '2', '12', '34', '2012-07-03 08:00:43', '2012-07-09 08:43:21', '2012-07-09 09:45:07', 'concluido', '03.07.12 - compareceu trazendo docs para contestar a ação n. 0017239-58.2010. Não se opõe a ação ajuizada, requerendo somente um prazo de aproximadamente 15 dias para desocupar o imóvel e quitar o débito. Diz que pagava o aluguel em nome de Cesar de Oliveira Machado na imobiliária, e que após agosto de 2009 não pagou mais o aluguel na imobiliária devido um derrame cerebral que sofreu. Que o requerido Cesar sumiu (foi para um garimpo) a algum tempo (não se recorda o mês exato), não tendo mais noticias do mesmo. Diz que dentro de 15 dias está vendendo um imóvel, momento no qual quitará seu débito. Diz que o imóvel é seu mas está em nome de outrem, possuindo somente procuração para  avenda. Se compromete a retornar com a matrícula do imóvel e a procuração (T).  \r\n\r\n09.07.12 - Compareceu com os docs solicitados, dos quais foram retiradas fotocópias e arquivadas para fins de avaliação sócio econômica; foi informado que o fato dele possuir uma fazenda com 5.790 hectares (ainda que não esteja em seu nome, e segundo ele tenha \'só mato\', mas conforme assumido pelo assistido, lhe pertence) impede que continue sendo assistido pela Defensoria Pública, sendo orientado a futuramente (aproximadamente 30 dias) constituir um advogado particular nos autos.  SEVERINO DA SILVA, RG 414023 SSP/AM, CPF 099468961-68.', 'sim', '198', '35');
