INSERT INTO `assistencias` VALUES ('75', '78', '9', '5', '5', '2012-07-03 08:45:46', '2012-07-03 08:45:46', '2012-07-03 09:00:02', 'concluido', 'O assistido é portador de degenaração macular relacionada à idade e edema macular secundário em olho esquerdo (CID H35.3). A acuidade visual é 20/200 em olhon esquerdo e portador de prótese ocular em olho direito. A doença que acomete o assistido pode lhe causar a perda da visão. Para tratamento foi prescrita a aplicação de intra-vítrea de Lucentis, o ranibizumabe, por tempo indeterminado, pois se trata de doença crônico-degenerativa. A médica subscritora do laudo informou expressamente que os tratamentos possíveis e disponibilizados pelos SUS foram abordados anteriormente e sem êxito. É aposentado pelo INSS, sendo que aufere renda de aproximadamente um salário-mínimo. Tem negativa do Estado e do Município.', 'sim', '03', '6');
