INSERT INTO `assistencias` VALUES ('97', '96', '1', '5', '41', '2012-07-03 08:59:35', '2012-07-03 08:59:35', '2012-07-03 09:52:59', 'concluido', 'Deseja propor ação de reparação de danos em face de empresa a quem fez proposta de prestação de serviços de fachada, tendo fornecido proposta escrita com a arte.\r\nO cliente ficou postergando por meses e pedia que ligasse no mes seguinte.\r\nPosteriormente, o recte verificou que o reclamado fez a fachada com outra pessoa, usando o seu trabalho intelectual', 'nao', '437', '41');
