INSERT INTO `assistencias` VALUES ('102', '103', '2', '11', '34', '2012-07-03 09:03:57', '2012-07-10 08:21:32', '2012-07-10 08:56:10', 'concluido', '03.07.12 - Compareceu pretendendo análise de seu contrato de financiamento de veículo, para verificar se os juros estão abusivos. Foi orientado a retornar com o contrato bancário, que alega ter solicitado a BV financeira, e que mesma enviará pelo email após o dia 06-07.12.\r\n\r\n10.07.12 - compareceu com o contrato do financiamento. Em análise ao contrato, com juros de 28,17%, verifica-se que estão dentro da normalidade, pois pelo BACEN a tx média foi de 25,19. Entretanto, deseja restituição de valores de serviços de terceiros, tarifa de cadastro, registro de cadastro e tarifa de avaliação do bem.', 'nao', '572', '35');
