INSERT INTO `assistencias` VALUES ('126', '126', '2', '14', '34', '2012-07-03 09:23:26', '2012-07-03 09:23:26', '2012-07-03 09:31:24', 'concluido', '03.07.12 - Diz que trabalha na área rural, em uma chácara do INCRA, na Fazenda Eldorado. Relata que são 9 hectares, mas ainda não é produtivo. Diz que trabalha como diarista para outra pessoa, e aufere 300 reais por semana. Afirma que financiou um veículo, no importe de R$600,00, sendo que deseja verificar se os juros estão abusivos. Foi orientado a retornar com a cópia do contrato bancário do financiamento para análise. ZEDEQUIAS DOS SANTOS DE MELO, RG 109.823 ssp-ms.', 'nao', '463', '34');
