INSERT INTO `assistencias` VALUES ('132', '132', '1', '5', '5', '2012-07-03 09:29:32', '2012-07-03 09:29:32', '2012-07-03 09:45:02', 'concluido', 'Compareceu a sobrinha da asssitida, alegando que sua tia é portadora de DPOC grave e que faz uso de formoterol e budesonida inalada, sem resposta satisfatória. Tem indicação do uso associado de tiotrópio inalado. A falta do medicamento pode acarretar em risco de exacerbações, internamentos e mortalidade. Não há medicameção substitutiva. Documentos necessários: negativa expressa e por escrito da Casa de Saúde e SESAU. Laudo médico conforme orientada. Comprovante de residência e cópia dos documentos pessoais. Orçamento do medicamento em pelos menos duas farmácias. Rertonar com documentos para ajuizamento da ação.', 'sim', '07', '6');
