INSERT INTO `assistencias` VALUES ('143', '141', '2', '5', '27', '2012-07-03 09:37:03', '2012-07-03 09:37:03', '2012-07-03 10:48:53', 'concluido', 'ATENDIMENTO DIFUSOS - Assistido trouxe documentação para propor Cumprimento de Sentença contra INEPAR.\r\nMediante análise socioeconômica, foi indeferido o seu atendimento pela Defensoria Pública em razão do assistido apresentar renda mensal de R$1800,00 a título de salário   R$1.000,00 (aprox), referente a aluguéis.\r\nAlém dos rendimentos mensais, o assistido possui 06 imóveis (03 lotes, 02 casas e 01 apartamento) automóvel e aplicação em investimentos de R$6.000,00', 'nao', '474', '28');
