INSERT INTO `assistencias` VALUES ('153', '151', '2', '16', '39', '2012-07-03 09:46:04', '2012-07-03 09:46:04', '2012-07-03 10:32:24', 'concluido', '03/07/2012 - cobrança de condomínio - CITAÇÃO - AUDÊNCIA DIA 05/07/2102.10ª vara.  FOI CITADO COM MENOS DE 10 DIAS DE ANTECEÊNCIA. NÃO QUER PEDIR A REDESIGNAÇÃO DA AUDIÊNCIA POIS AFIRMA QUE A EMPRESA EM QUE TRABALHA JÁ O LIBEROU PARA O DIA 05/07. propõe pagar 30,00 por mês mais o condomínio atual. não tem docs para defesa que deverá ser feita de modo verbal, na audiência.', 'nao', '482', '39');
