INSERT INTO `assistencias` VALUES ('155', '154', '35', '16', '5', '2012-07-03 09:50:00', '2012-07-10 08:02:26', '2012-07-10 10:30:05', 'concluido', 'Compareceu o assistido à DPE alegando que consta como executado nos autos autos da ação 0067230-66.2011.8.12.0001, em trâmite pelo juízo e cartório da 2ª vara de fazenda pública, promovidos pela FUNDAÇÃO SOCIAL DO TRABALHO DE CAMPO GRANDE - FUNSAT. Alega que celebrou contrato de mútuo em favor da empresa ARA COMÉRCIO DE ALIMENTOS LTDA - ME, juntamente com seus outros dois sócios, EDUARDO NOGUEIRA FARIAS e ADRIANO URUNAGA FERNANDES. Informa que se retirou da empresa em 2007, contudo não se recorda de ter feito o registro da alteração na Junta Comercial. Pedido de desarquivamento (Suzete). Ligar para assistido. ', 'nao', '749', '5');
INSERT INTO `assistencias` VALUES ('156', '153', '9', '13', '47', '2012-07-03 09:50:16', '2012-07-03 09:50:16', '2012-07-03 10:11:09', 'concluido', 'retorno, apresenta rol de testemunhas para elaboração de inicial. ', 'sim', '485', '47');
INSERT INTO `assistencias` VALUES ('157', '155', '9', '14', '41', '2012-07-03 09:50:19', '2012-07-03 09:50:19', '2012-07-03 12:10:51', 'concluido', 'AÇÃO DE RESCISÃO DE CONTRATO\r\nTem imóvel da EHMA, vendeu por contrato particular em 2005. A adquirente revendeu e as parcelas não estão sendo pagas.\r\nAtualmente estão na posse Cátia e Fábio de tal.\r\nTem proposta de regularização da EMHA, pois o contrato está em seu nome, de modo que pretende a rescisão do contrato com reintegração de posse. \r\nEstá ciente de que pode ser condenado a devolver o valor recebido pela cessão', 'nao', '481', '41');
INSERT INTO `assistencias` VALUES ('158', '143', '1', '20', '41', '2012-07-03 09:50:21', '2012-07-03 09:50:21', '2012-07-03 09:53:31', 'concluido', 'Foi enviado ofício às Casas Bahia, com o seguinte teor:\r\nCompareceu a esta Defensoria o Sr. JOÃO AUGUSTO RODRIGUES, apresentando a seguinte reclamação:\r\nO Reclamante esteve em loja dessa empresa acompanhado de uma mulher cujo nome completo desconhece, sabendo apenas que se apresenta como ?Patricia?.\r\nO Reclamante tinha intenção de ser avalista em contrato de financiamento de móveis de Patrícia; que ao invés disso, foi feito contrato de financiamento em seu nome; que os móveis adquiridos foram retirados no depósito por Rosa Aparecida Silva Moraes Soares.\r\nConsiderando que os bens foram adquiridos em nome do Reclamante, não se justifica a entrega a pessoa estranha, não autorizada pelo Reclamante.\r\nO Reclamante é homem idoso, com 81 anos de idade, não sabe ler e escrever e foi induzido em erro, ao ser levado a assinar contrato diverso daquele que pretendia.\r\nA adquirente não está pagando as prestações do financiamento e o Reclamante recebeu carta do SERASA, comunicando que o nome seria inscrito naquela instituição.\r\nCabe registrar, ainda, que o Reclamante havia tomando conhecimento de dois contratos (um de compra de um armário e um de conjunto de sofá), no entanto o SERASA comunicou inadimplemento de três contratos (cópia anexa).\r\nConsiderando as irregularidades acima relatadas, o Reclamante, orientado por seus familiares, que não tinham conhecimento dos fatos, deseja a anulação dos contratos. \r\nPelo exposto, solicitamos que o caso seja avaliado na esfera administrativa da empresa e, em caso de não acolhimento da pretensão do consumidor, com fulcro no inciso IV do art. 104 da Lei Complementar 111/205 e art. 89, inciso X da Lei Federal nº 80 de 12.01.94, REQUISITAMOS a Vossa Senhoria que seja encaminhado à Defensoria Pública (endereço do rodapé), informações escritas sobre o problema noticiado, instruídas com cópias de todos os contratos firmados pelo Reclamante, no prazo de 10 a contar do recebimento desta.\r\n', 'sim', '1', '42');
