INSERT INTO `assistencias` VALUES ('184', '97', '2', '16', '34', '2012-07-03 10:21:12', '2012-07-03 10:21:12', '2012-07-03 10:55:41', 'concluido', '03.07.12 - Foi notificada por Gaudêncio Eulálio. Diz que Gaudêncio é casado com sua mãe com o regime de separação parcial de bens, mas que estão separados de fato; que sua mãe é doente (mal de alzheimer, diabetes, pressão alta, dependendo da filha até para realizar higiene pessoal);  Foi orientada a entrar com ação de separação da mãe e de Gaudêncio na DPE da Família, caso tenha interesse.Que pagou débitos do imóbvel de seu próprio bolso no montante aproximado de R$ 7.000,00 de maneira que o valor do aluguel de R$ 400,00 é revertido totalmente para pagar as despesas tidas.\r\nSerá feito ofício solicitando a matrícula do imóvel e pedido de desarquivamento dos autos n. 0016401-18.2010. \r\nDeverá retornar semana que vem com:\r\n- cópia da matrícula do imóvel;\r\n- cópia da certidão de casamento;\r\n- cópia dos comprovantes de todos as despesas do imóvel;\r\n- cópia dos comprovantes de todos os pagamentos de despesas realizados refrentes ao imóvel (no valor aproximadamente de R$ 7.000,00);\r\n- Extratos do IPTU do imóvel.', 'nao', '442', '35');
INSERT INTO `assistencias` VALUES ('185', '179', '9', '33', '3', '2012-07-03 10:21:37', '2012-07-03 10:21:37', '2012-07-03 11:13:52', 'concluido', 'retificação registro da filha, em razão de alteração de nome do avô materno.', 'nao', '649', '3');
INSERT INTO `assistencias` VALUES ('186', '182', '11', '25', '21', '2012-07-03 10:30:09', '2012-07-09 09:40:39', '2012-07-09 11:18:57', 'concluido', '03/07/2012 - orientação sobre compra e venda - audiência para dia 09/07/2012 às 10:00.\r\n\r\nobs. existe sentença de improcedência no juizado especial, a assistida perdeu a causa porque não provou os fatos - ação de obrigação de fazer - para transferir em nome do atual possuidor, ex-companheiro da assisitda. sugerido bloquear a moto e tentar na via administrativa, blitz etc.....', 'nao', '536', '21');
