INSERT INTO `assistencias` VALUES ('263', '256', '1', '17', '47', '2012-07-04 07:30:41', '2012-07-04 07:30:41', '2012-07-04 08:25:48', 'concluido', 'que, adquiriu um computador Not book na PERNAMBUCANAS FINANCIADORA, pelo valor de R$ 1.899,00, mediante financiamento que ficou de pagar R$ 2.179,00. Tal valor para pagamento em 18 parcelas no valor de R$ 181,51. Que pagou apenas 2 parcelas, vindo a deixar de pagar por  ficar desempregada. Dai sobreveio um acordo em maio/2011 para pagamento do valor em débito estimado em R$ 4.444,61, a ser pago por meio de uma entrada no valor de R$ 1.000,00 mais 9 parcelas de R$ 409,18. Pagou somente  a entrada. Semana passada esteve em contato com a empresa, que passou um saldo devedor de cerca de R$ 10.000,00. Ora, pretende pagar o valor justo. Aguarda realizar cálculo e eventual propositura de ação. ', 'nao', '514', '47');
