INSERT INTO `assistencias` VALUES ('274', '268', '19', '14', '37', '2012-07-04 07:40:15', '2012-07-09 07:16:04', '2012-07-09 09:07:38', 'concluido', '- Açãqo de Rescisão contratual e reintegração de posse de imovel adquirido em 96 prestações - pedido de vista do processo 0029410-76.2012.8.12.0001, 16ª VC para apresentar contestação. Ainda não houve a citação. Entrar em contato com assistido quando processo vir com vista.\r\nEm 09/07/2012 -RETORNO  - foi informado q terá q retornar até 23/07/12 p/ efetuar proposta de acordo, pois tem interesse em manter o contrato; alega q constuiu no local e as benfeitorias estão avaliadas em R$ 35.000,00; pagou apenas 5 parcelas e está em atraso desde 2009', 'nao', '475', '37');
