INSERT INTO `assistencias` VALUES ('283', '274', '1', '13', '34', '2012-07-04 07:45:25', '2012-07-04 07:45:25', '2012-07-04 08:39:41', 'concluido', '04.07.12 - CASO NOVO - diz que realizou contrato de cessão de direitos com Nara Ortência referente a um veículo que estava com o motor fundido, com a condição de quitar o preço avençado após a homologação do inventário n. 0109788-58.2008 que está em tramite (eis que pretende vender sua parte da herança); que o declarante arrumou o carro; que emprestou o veículo para a cedente várias vezes vir ao médico de (de aquidauana a campo grande) sem problemas; que no dia 25/06/12 a mesma pediu o veiculo novamente emprestado para ir ao médico fazer um curativo; que o namorado da cedente passou pegar o veículo na parte da manhã; que no mesmo dia, por volta das 13:00 hrs o declarante começou a ligar para a cedente; que por volta das 17:00 hrs daquele dia a cedente atendeu a ligação, e lhe disse que não mais lhe entregaria o veículo, sem nenhuma justificativa. O declarante continua em posse do documento do veículo, e pleiteia a reintegração de posse do mesmo. Se compromete a retornar quinta feira (12.07) com nome e endereço de três testemunhas, cópia autenticada do contrato e do documento do veículo.     ', 'nao', '518', '35');
