INSERT INTO `assistencias` VALUES ('287', '276', '27', '5', '5', '2012-07-04 07:49:21', '2012-07-09 07:03:24', '2012-07-09 08:10:12', 'concluido', '04/07/2012 - caso novo - reclama que comprou um colchão da Magno Sono, que está lhe trazendo problemas na coluna. Além disso, foi enganado pela vendedora ambulante, que entrou em sua residência, fez propaganda do produto e como o assistido não tinha dinheiro, a vendedora convenceu a esposa do assistido a ir ao banco, fazer um empréstimo no banco do Brasil, para descontar em folha do INSS, pois são idosos e aposentados. Feito o empréstimo, a ser pago ao banco em 60 X R$ 160,77. Pagaram o colchão a vista, no valor de R$ 4.300,00 cf recibo. A compra e venda foi feita pela esposa do assistido CECÍLIA MOCHI CORREA e a vendedora ambulante. Cecília deve constar do polo ativo também. Ag. docs e compraecimento de Cecília.\r\n\r\n09/07/2012 - retorno - a Sr.ª Cecilia Mochi Corrêa (esposa) esteve presente. Pegamos os documentos para extração de fotocópias, e a ambos assinaram a declaração.', 'sim', '174', '5');
