INSERT INTO `assistencias` VALUES ('295', '286', '2', '29', '41', '2012-07-04 07:55:12', '2012-07-04 07:55:12', '2012-07-04 09:02:37', 'concluido', 'Compareceu para esclarecimentos acerca da ação no juizado (autos nº 0005477-38.2012.8.12.0110), no qual figura como vítima por ter representado contra a acusada Madalena dos Santos Rosa, pela prática do delito de ameaça (art. 147, CP).\r\nEm atendimento foi informada de que o delito de ameaça absorve o delito de difamação, por ser mais grave, e que o delito de calúnia (art. 138, CP) não havia sido configurado, pois a acusada não lhe imputou nenhuma conduta criminosa.\r\nAssim, optou por dar prosseguimento à representação quanto ao delito de ameaça e por desistir de representar pelo delito de calúnia.\r\nAguardar a designação de audiência, no qual será intimada a comparecer.', 'nao', '520', '42');
