INSERT INTO `assistencias` VALUES ('310', '300', '22', '44', '3', '2012-07-04 08:06:46', '2012-07-05 07:08:21', '2012-07-05 08:46:43', 'concluido', 'Deseja atendimento para processo em andamento nos juizados especiais fazenda. Não trouxe docs sobre renda. prazo em andamento. senha de retorno para amanha 05/07/2012. Trouxe documentos em 05/06/12, aguardando apresentação de razões Juizado', 'sim', '121', '4');
INSERT INTO `assistencias` VALUES ('311', '302', '2', '5', '34', '2012-07-04 08:07:28', '2012-07-04 08:07:28', '2012-07-04 09:15:44', 'concluido', '04.07.12 - compareceu e após lida toda a contestação dos autos n. 0059808-40.2011 prestou os seguintes esclarecimentos: que uma conhecida sua havia proposto ação para receber os valores do DPVAT por intermédio de duas moças; que o declarante conversou com tais moças (que saem \'\'caçando\'\' clientes para o advogado requerido); que o declarante assinou a procuração e o contrato de prestação de serviços advocaticios em uma loja de xerox, com tais moças, sem nunca ter visto ou conversado com o advogado requerido; que no momento da assinatura da procuração e do contrato tais moças não lhe entregaram cópia do contrato porque faltava a assinatura do advogado, dizendo que lhe seria entregue uma cópia mais tarde; que nunca lhe entregaram cópia do contrato; que não se opõe ao pagamento de 30% dos honorários advocaticios entabulados no contrato; que nunca se negou a pagar os 30% (só que o advogado \'\'sumiu\'\' com o dinheiro todo sem lhe entregar nada); que inclusive antes de registrar o B.O ligou para o advogado requerido e pediu que lhe fosse depositado somente o que lhe era devido, com os 30% descontados, mas o advogado se negou dizendo que \'\'não sabia quem havia pego o dinheiro\'\'; que no momento da propositura da inicial não juntou cópia do contrato porque não possuia cópia nenhuma, e que não mencionou à defensora a existência de tal contrato porque não tocou-se no assunto a respeito do pagamento entabulado, passando tal ponto despercebido. Cleíltom Barbosa Camposano, RG 001138783 SSPMS, CPF 930167781-49. ', 'nao', '523', '35');
