INSERT INTO `assistencias` VALUES ('327', '316', '2', '27', '5', '2012-07-04 08:18:42', '2012-07-04 08:18:42', '2012-07-04 08:55:59', 'concluido', 'Foi autuada por crime ambiental por transportar dois filhotes de maritacas. Voltava de uma festa de seu aniversário em uma chácara na região do São Julião. Encontrou os dois filhotes caídos no chão, numa poça d´água. No retorno. Estrada de terra. Domingo. Iria levar para o CRAS na segunda. Sua cunhada estava dirigindo o caso e foi parada após ultrapassagem. Teve que pagar R$ 1.000,00 de multa. Tem procedimento do 11º Juizado. Orientada possibilidade de ação no juizado fazenda para anular a infração. Vai pensar.', 'nao', '672', '5');
