INSERT INTO `assistencias` VALUES ('341', '327', '1', '39', '5', '2012-07-04 08:26:43', '2012-07-04 08:26:43', '2012-07-04 08:59:28', 'concluido', 'Compareceu a assistida à DPE informando ser portadora de Hepatite C. Necessita do medicamento TELAPREVIR, dose de 02 compromidos de 8/8 horas, pelo período, a princípio, de 03 meses. É contadora na empresa Audimax, auferindo como salário o importe de R$ 1.120,40. Trouxe negativa do Estado.\r\nOrientada a trazer negativa expressa também do Município de Campo Grande (SESAU - Rua Bahia - antiga Águas Guariroba). Retornar com documentos para ajuizamento da ação.', 'nao', '674', '6');
INSERT INTO `assistencias` VALUES ('342', '328', '2', '5', '32', '2012-07-04 08:28:41', '2012-07-04 08:28:41', '2012-07-04 08:52:57', 'concluido', 'Reclamação defeito de celular contra Extra e fabricante, Huawey; proposta devolução do valor pago por este no Procon. Não aceitou. Alertado dos riscos de insucesso de ação que pleiteie indenização por danos morais, fará contraproposta ao fornecedor.', 'sim', '536', '32');
