INSERT INTO `assistencias` VALUES ('346', '333', '1', '39', '5', '2012-07-04 08:32:16', '2012-07-04 08:32:16', '2012-07-04 09:04:30', 'concluido', 'Compareceu o neto (Renato). Trouxe apenas receitas de pedidos de aspirador, balão de oxigênio, fralda descartável e dersani tópico. Não trouxe laudo. Fez cirurgia no estômago. Não há negativa. Orientação a pegar o laudo e as solicitações e pedir administrativamente na SESAU e Casa da Saúde. Com as negativas e demais documentos, inclusive cópia RG, CPF e comprovante de residência, retornar.', 'nao', '676', '5');
INSERT INTO `assistencias` VALUES ('347', '334', '1', '14', '41', '2012-07-04 08:32:42', '2012-07-09 07:47:50', '2012-07-09 09:19:55', 'concluido', 'Foi citado para apresentação contestação na ação de rescisão contratual (autos nº 0018766-74.2012.8.12.0001), assinou declaração, mas ficou de retornar com os documentos solicitados e acompanhado de sua esposa, Ana Rita, que também é ré no processo e precisa assinar a declaração.\r\n\r\nA Sra. Ana Rita trouxe documentos e assinou declaração de justiça gratuita, ficou de retornar com o orçamento da mão-de-obra utilizada na construção das benfeitorias e com as cópias dos boletos que foram pagos.', 'nao', '492', '42');
INSERT INTO `assistencias` VALUES ('348', '332', '9', '33', '3', '2012-07-04 08:33:01', '2012-07-04 08:33:01', '2012-07-04 09:16:53', 'concluido', 'retificação de registro de óbito do antigo marido, vez que na certidão de óbito constou como ele sendo ainda casado', 'sim', '675', '3');
INSERT INTO `assistencias` VALUES ('349', '232', '2', '29', '23', '2012-07-04 08:34:17', '2012-07-04 08:34:17', '2012-07-04 08:53:32', 'concluido', 'Processo no 5º Juizado. Ação n. 0000486-34.2012.8.12.0105, Indenização. Alega que o requerido queimou sua casa com os pertences, mas não trouxe qualquer testemunha ou documentos a comprovar os fatos. Sentença de ilegitimidade, já que não demonstrou que era proprietário ou ocupante do imóvel. Orientado a fazer boletim de ocorrência de crime de dano, oportunidade em que pode realizar composição cível dos danos sofridos, bem como comprovar, através de testemunhas, os danos ocasionados pelo requerido. ', 'nao', '511', '23');
