INSERT INTO `assistencias` VALUES ('351', '337', '2', '25', '39', '2012-07-04 08:36:52', '2012-07-04 08:36:52', '2012-07-04 09:41:42', 'concluido', '04/07/2012 - veio saber sobre financiamento e acordo extrajudicial - contrato em nome de sua mãe MARIZE DO CARMO CAVALHEIRO. trazer a mãe e o contrato para análise. Trouxe também outros casos, de outras pessoas, fazendo consulta para terceiros que não vieram a esta DPE. Orientado a falar para os interessados comparecerem pessoalmente, cada um com seu caso, e com docs para análise do Defensor designado para atender cada um deles. ', 'nao', '542', '39');
