INSERT INTO `assistencias` VALUES ('355', '339', '2', '16', '23', '2012-07-04 08:39:38', '2012-07-04 08:39:38', '2012-07-04 09:20:44', 'concluido', 'É proprietaria do imóvel juntamente com outros cinco irmãos. Um faleceu e a namorada deste reside no imóvel, com um filho do \"de cujus\". Esta não realiza as reformas necessárias, bem como o pagamento do IPTU. T.A. para o dia 19 de julho, às 14:00 horas. Deseja que efetue o pagamento dos débitos, inclusive das taxas de agua e energia, bem como realize a locação da outra construção existente no imóvel, para fins de manutenção do imóvel, ou venda.', 'nao', '540', '23');
