INSERT INTO `assistencias` VALUES ('361', '347', '22', '5', '39', '2012-07-04 08:44:38', '2012-07-04 08:44:38', '2012-07-04 09:05:48', 'concluido', '03/07/2012 - Trouxe docs para ajuizar ação de Indenização por danos materiais e morais em face de Fascinação Noivas, uma vez que alugou o traje completo para a filha usar em sua festa de 15 anos, mas a empresa só entregou a saia, o forro de tule, a luva e a coroa. entregou tb um vestido prateado que seria um \"brinde\" para a aniversanriante receber os convidados antes da meia noite. não entregou o corpete, por isso não pôde usar o traje de gala. Alega que a filha chorou muito. Trouxe DVD e algumas fotos. Os prejuízos materiais ficaram em R$ 350,00 (preço total do aluguel) a empresa não devolveu a nota promissória (caução) de R$ 800,00 assinada com o contraato. Os danos morais deverão ser arbitrados. Ajuizar ação.', 'sim', '561', '39');
