INSERT INTO `assistencias` VALUES ('367', '354', '12', '26', '21', '2012-07-04 08:49:41', '2012-07-04 08:49:41', '2012-07-04 09:55:04', 'concluido', 'Redirecionei o atendimento, pois estou atendendo o autor na ação da 12ª V Civ - autos 0074244-72.2009.8.12.0001 e a subscritora da inicial foi a Drª Leslie, que atuaria pela ré, assim, pedi ao Dr. Ilton que prosseguisse no atendimento pelo impedimento da titular no conflito. Atende ainda nesta data.\r\nEncaminhei à recepção para anotaçoes', 'nao', '546', '27');
INSERT INTO `assistencias` VALUES ('368', '353', '2', '15', '34', '2012-07-04 08:50:06', '2012-07-04 08:50:06', '2012-07-04 10:44:56', 'concluido', '04.07.12 - diz que está no lote 08 quadra 197 do bairro jardim noroeste a mais de 12 anos; que o lote estava vago e abandonado quando ele e sua convivente Rosimar Neres Fernandes adentraram no imóvel; que nunca houve oposição e a posse sempre foi mansa e pacifica; que a aproximadamente 2 meses atrás o sobrinho do dito proprietário apareceu reinvindicando o imóvel; pretende propor ação de usucapião; se compromete a retornar dia 17.07.12 (terça feira) com a matrícula do imóvel. Adriano Soares Macedo, RG 001288422 SSP/MS, CPF 005335671-30.', 'nao', '548', '35');
