INSERT INTO `assistencias` VALUES ('387', '373', '1', '41', '5', '2012-07-04 09:08:31', '2012-07-04 09:08:31', '2012-07-04 09:54:42', 'concluido', 'Compareceu a assistida à DPE, alegando que seu sobrinho, CEZAR ADOLFO PALOMO, filho de Pedro Adolfo e Neide Palomo Adolfo, portador da cédula de identidade RG nº 744.982 – SEJUSP/MS, inscrito no CPF sob o nº 608.776.501-87, residente na Rua Colombo, nº 690, Bairro Vila Nasser, foi atropelado quando saía do serviço, por volta das 17h00min, no dia 25/05/2012. Que, desde então, permanece internado, já que sofreu várias lesões. O motorista se evadiu do local. Está internado na Santa Casa. Conforme informação do médico, precisa realizar cirurgia no fêmur. Para tanto, precisa dos seguintes materiais: a) conjunto de haste femoral modular revisão Restoration; b) cabeça carâmica; c) componente acetabular não cimentado; d) liner em polietileno; d) parafuso acetabular; e) loban; f) aspirador. O custo dos materiais, conforme orçamento, atinge o importe de R$ 39.206,00, na Centroeste Implantes, e R$ 43.580,00, na Medicalta – Produtos Hospitalares Ltda. O assistido e suas família não têm condições financeiras de arcar com a aquisição dos materiais. O assistido trabalhava como pedreiro. Recebia em torno de R$ 250,00 por semana. Era autônomo. \r\nOrientada a pegar laudo médico, conforme especificações entregues em separado. Com o laudo, dirigir-se à Casa de Saúde (Estado de Mato Grosso do Sul) e à SESAU (Município de Campo Grande) para agendamento da cirurgia, com a máxima urgência. Em caso de negativa, retornar à Defensoria Pública Estadual para ajuizamento de ação.\r\nTrazer: documentos pessoais do assistido, declaração assinada, orçamento dos materiais, laudo médico, negativa da Casa de Saúde e Sesau.\r\n', 'nao', '686', '6');
