INSERT INTO `assistencias` VALUES ('389', '372', '23', '25', '34', '2012-07-04 09:09:18', '2012-07-04 09:09:18', '2012-07-04 10:43:15', 'concluido', '04.07.12 - Compareceu relatando que é proprietária do terreno n. 07 da quadra 32 do loteamento jardim Presidente, e que, na realidade, o imóvel está em condomínio com a pessoa de Luiz Fernando Simões. Diz que no mesmo terreno, existem duas casas, uma do lado direito, e outra do lado esquerdo, sendo a sua casa fica esquerdo e tem como número 184, e e Luiz Fernando é 176. Diz que com relação ao IPTU consultou a prefeitura e descobriu que o imposto está correndo. Entretanto, sua reclamação é que deseja fazer o pagamento do asfalto, mas ficou sabendo que o carnê está em mãos de Luiz Fernando. Afirma que chegaram dois carnês de asfalto, os dois no nome de Luiz, mas com a numeração das duas casas. Compareceu à Prefeitura, e a prefeitura não quis emitir qualquer boleto em nome da assistida, que também consta como proprietária do bem. Relata que é também proprietária do bem, e que deseja depositar em juízo as parcelas do asfalto. Diante da pretensão desejada, foi encaminhada para a Defensoria Pública da Fazenda Municipal (Dra. Zeliana). Com relação a possível desmembramento, foi orientada a comparecer perante a SEMADUR, para solicitar as providências e verificar a possibilidade de fazê-lo, visto que somente com a aprovação da Prefeitura, após procedimento administrativo, será possível averbar desmembramento perante o Cartório. Ligamos para o engenheiro Valdecy, da SEMADUR (3314-3557), ocasião em que solicitamos informação se existe em trâmite perante a SEMADUR algum procedimento em nome da assistida para desmembramento, e o mesmo afirmou que, em consulta à inscrição 0310006010-7, nada foi encontrado.Como a assistida relata que houve presença de engenheiros da Prefeitura em seu imóvel, foi expedido ofício 57-12, solicitando informações por escrito a SEMADUR a respeito da existência de procedimento de desmembramento.', 'sim', '572', '34');
