INSERT INTO `assistencias` VALUES ('419', '399', '2', '25', '34', '2012-07-04 10:00:59', '2012-07-04 10:00:59', '2012-07-04 11:22:26', 'concluido', '04.07.12 - CASO NOVO - Compareceu aludindo que financiou pela CEF um imóvel, que no contrato consta com medição de 10,00m de frente, no entanto, devido a construção de um portão do condomínio, o mesmo ficou com apenas 9,40m; quer que o portão seja mudado de local (ação de obrigação de fazer); diz que ainda não falou com a construtora a respeito, e decidiu falar com a mesma para ver se não mudam o portão de lugar amigavelmente; caso a construtora se negue, retornará para que seja enviada uma intimação a fim de solucionar o caso mediante acordo. Veio receber orientação também sobre uma cláusula do financiamento da CEF que cobra um certo valor enquanto a construção estiver sendo erigida, a qual está sendo paga apesar da construção já estar findada a muito tempo. Sobre está questão foi orientado a procurar a DPU, por envolver revisão de contrato da CEF. Rogério da Silva Faria, RG 001134968 SSPMS; CPF 9652802104.', 'nao', '587', '35');
