INSERT INTO `assistencias` VALUES ('449', '423', '22', '20', '47', '2012-07-05 07:11:05', '2012-07-10 07:12:54', '2012-07-10 08:32:34', 'concluido', 'Que, admite ter recebido uma conta do ano de 2007, num valor exorbitante, que acabou não pagando. Além disso, o imóvel ficou alugado para a inquilina GISELE PIRES FERREIRA BUENO durante o período, ao que parece, de abril/2011 a abril/2012. Em consequência do não pagamento, o fornecimento da energia foi suspensa desde maio/2012. Já realizou reclamação junto ao PROCON onde foi feita uma proposta de parcelamento do débito, que admite não ter condições de assumir. Expedido ofício a ENERSUL, solicitando planilha e informaçãos sobre o débito. aguarda retorno com demais docs para elaboração inicial. \r\nEm 10.07.12, apesar de se aguardar ainda informações solicitadas à ENERSUL, foram pegos docs para elaboração da inicial.  ', 'sim', '027', '47');
