INSERT INTO `assistencias` VALUES ('481', '455', '9', '13', '47', '2012-07-05 07:35:58', '2012-07-05 07:35:58', '2012-07-05 08:09:44', 'concluido', 'É proprietário de um lote de terreno adquirido pela Construtora Vicky no ano de 1983. Veio ao seu conhecimento uma ação de usucapião n. 0000101-10.2012 proposto pela autora Luciene Gamarra Lopes. Pretende contestar ação ou propor ação de reintegração de posse, uma vez que não nunca exerceu a posse do lote de terreno e não faz parte do polo passivo da ação. Pedido de Vsita. Aguardando carga dos autos.', 'sim', '134', '48');
