INSERT INTO `assistencias` VALUES ('518', '490', '23', '11', '41', '2012-07-05 08:06:04', '2012-07-05 08:06:04', '2012-07-05 09:21:40', 'concluido', 'A Reclamante possui um cartão de crédito dessa empresa nº 5447.3176.0780.4042.  Gastou cerca de 600,00 e pagou o mínimo por alguns meses e parcelou as faturas três vezes. Além disso havia cobrança de título de capitalização, no valor de R$ 32,48 e seguro do cartão.\r\nNeste mês estava com saldo devedor de R$ 1.627,27 e fez parcelamento para pagar 08 parcelas de R$ 286,72, devendo pagar a primeira no dia 06/07/2012. \r\nA reclamante não compreende em que consistiu a evolução do saldo devedor. Não tem cópia do contrato de adesão e nem de todas as faturas mensais.\r\nInforma também que solicitou cancelamento do título de capitalização, tendo resgatado o saldo existente no mês de junho, modo que deve ser verificado se efetivamente houve o dito cancelamento, pois a fatura de julho ainda contém uma cobrança. \r\nOfício nº 105/35DP/212', 'nao', '406', '41');
