INSERT INTO `assistencias` VALUES ('560', '522', '2', '16', '23', '2012-07-05 08:45:16', '2012-07-05 08:45:16', '2012-07-05 10:27:26', 'concluido', '5/7/2012: Caso novo. É mototaxista e contratou um auxiliar para utilizar sua moto, vindo este a causar acidente de trânsito. Seguradora entrou em contato e fizeram acordo, sendo que a vista teria desconto de 30 % e a prazo seria em 50 parcelas fixas. Concordou com o parcelamento, remetendo a seguradora o acordo e os boletos. Pensou melhor e quer a vista, mas a seguradora disse que não haveria tempo para a remessa do novo boleto, orientando-o a pagar a primeira parcela, sendo que remeteriam novo boleto com o desconto da parcela paga no preço a vista. Assistido não queria efetuar o pagamento, querendo um único boleto, com o valor a vista. Ocorre que não há qualquer acordo por escrito com relação ao desconto. Assim, foi orientado a efetuar o pagamento da primeira parcela, já que o desconto é uma faculdade da Seguradora. \r\nQuer também entrar com ação regressiva contra o auxiliar, mas não sabe informar até onde vai a responsabilidade daquele, eis que não foi realizado qualquer contrato. Irá verificar e caso resolva ingressar com ação, irá entrar diretamente no Juizado de Pequenas causas, ou irá retornar nesta DP.', 'nao', '431', '23');
INSERT INTO `assistencias` VALUES ('561', '524', '17', '29', '39', '2012-07-05 08:46:47', '2012-07-05 08:46:47', '2012-07-05 09:24:37', 'concluido', '05/07/2012 - atermou reclamação no Juizado: quer a rescisão de contrato de aluguel. Já entregou o imóvel, mas o proprietário entende que o assistido não fez a pintura e acordo com o contrato. AIJ dia 30/07/2012. ', 'nao', '432', '39');
