INSERT INTO `assistencias` VALUES ('573', '508', '1', '11', '34', '2012-07-05 08:55:16', '2012-07-05 08:55:16', '2012-07-05 09:23:16', 'concluido', '05.07.12 - caso novo - quer propor ação revisional contra o banco itaú  com relação a sua conta corrente, e encargos do limite do cheque especial. Diz que não consegue nunca pagar seus débitos, que crescem exorbitantemente, e que a origem do débito atual de R$ 14.753,77, é oriundo de um empréstimo que fez no mesmo banco. Não possui o contrato de abertura de conta corrente, e não trouxe o contrato do empréstimo, sendo orientada a retornar semana que vem com os aludidos contratos, e com extratos detalhados que demonstrem o início da dívida. BEATRIZ TRINDADE BENITES PINTO, RG 944698, CPF 81136862153.', 'nao', '412', '35');
