INSERT INTO `assistencias` VALUES ('575', '534', '20', '51', '34', '2012-07-05 08:56:13', '2012-07-05 08:56:13', '2012-07-05 09:15:52', 'concluido', '05.07.12 - 015831-61.2012.8.12.0001 - Cumprimento de sentença. Compareceu dizendo que entrou em contacto com a d. irene, para fazer acordo, e esta mostrou disposição, e disse que entraria em contacto com sua advogada. Diz que irene falou com sua advogada, e que dará a resposta até 6.a feira. Assim, Erço comparece dizendo que esperará até 6.a feira, e semana que vem retornará, para comunicar a dpe sobre a resposta, pois, se for, negativa, estudará uma proposta melhor.', 'nao', '445', '34');
INSERT INTO `assistencias` VALUES ('576', '537', '11', '29', '41', '2012-07-05 08:56:37', '2012-07-05 08:56:37', '2012-07-05 09:52:32', 'concluido', 'Foi intimado para audiência de instrução e julgamento (autos nº 0002062-47.2012.8.12.0110) designada para o dia 25/07/2012 às 15h45min.\r\nApresentou documentos a serem juntados e informou que tem testemunhas que levará na audiência.', 'sim', '444', '42');
INSERT INTO `assistencias` VALUES ('577', '536', '1', '62', '5', '2012-07-05 08:56:41', '2012-07-05 08:56:41', '2012-07-05 10:00:19', 'concluido', 'DEFESA EM PROCESSO ADMINISTRATIVO: Compareceu o assistido à DPE, alegando que foi notificado para apresentação de defesa nos autos nº 55990/2012-67, da Coordenadoria de Julgamentos e Consultas, da SESAU. A infração é de que o assistido teria soltado em via pública um carrocho que estava em sua propriedade, sendo que o animal era de seu irmão, Arlindo Granville de Souza. Informa que, em verdade, o imóvel era da família do assistido. Que, no início do ano, foi regularizada a transferência do imóvel para o nome do assistido e, em seguida, vendido a terceiro. O assistido mora no Bairro Flamboyant há mais de 06 anos. O imóvel onde ocorreu os fatos fica no bairro Aero Rancho. Seu irmão é que residia no imóvel. Observa que, na ocasião, seu irmão estava preso por inadimplemento voluntário de alimentos, desde 06/12/2011. Que não possui má conduta com animais, pois há pouco tempo realizou todos os procedimentos necessários a verificação de doenças em cachorro de seus filhos (trouxe documentos). ', 'nao', '707', '6');
INSERT INTO `assistencias` VALUES ('578', '538', '2', '15', '23', '2012-07-05 08:57:43', '2012-07-05 08:57:43', '2012-07-05 10:31:34', 'concluido', '5/7/2012. Retorno: Chegaram as respostas de Camapuã, contudo, o imóvel está em nome da pessoa de Crispim, que deixou testamento para Aparecido, contudo, não descreveu o imóvel, mencionando apenas que é de Campo Grande. Ação de Adjudicação compulsória. Foi oficiado aos CRIs de Campo Grande, para informar se existem imóveis em nome do testador Crispim, para após, solicitar os demais docs para a ação. Of. 135 a 137/2012', 'nao', '447', '23');
