INSERT INTO `assistencias` VALUES ('580', '540', '26', '25', '32', '2012-07-05 09:04:03', '2012-07-05 09:04:03', '2012-07-05 11:13:10', 'concluido', 'Procurou a Defensoria pois haveria contratado um seguro que em caso de desemprego involuntário quitaria 06 parcelas do financiamento feito com a CEF da casa onde reside. Ocorre que diversamente do que pensa a assistida o seguro é de vida e a antecipação de pagamento é das prestações do seguro (cláusula 3.5.2) e não do financiamento da casa. Orientada a caso tenha interesse em ajuizar ação contra a CAIXA procurar a Defensoria da União, pois no entender da assistida a orientação era de quitação das parcelas de 06 parcelas da casa e não do seguro.', 'nao', '428', '33');
