INSERT INTO `assistencias` VALUES ('615', '574', '1', '39', '5', '2012-07-05 10:40:15', '2012-07-05 10:40:15', '2012-07-05 10:57:22', 'concluido', 'Compareceu à Defensoria Pública a mãe do assistido, Sra. Julia Marilete Quintana Correa da Costa, alegando que seu filho é portador de Diabetes Mellitus tipo 2 (CID E11.9). Necessita de medicamento: insulina glargina 100U/ml - 10 refis e insulina lispro 100U/ml - 5 refis, para uso contínuo e por tempo indeterminado. Não possui condição financeira de arcar com o custo do tratamento. Trabalha como motorista na empresa Planalto Limpeza e Conservação de Ambientes, auferindo remuneração em torno de R$ 990,00. Tem negativa do Estado e do Município. Tem laudo médico. Orientada a retornar com os documentos, bem como com a declaração da Defensoria Pública devidamente assinada. Aguardar retorno para ajuizamento.', 'sim', '713', '6');
INSERT INTO `assistencias` VALUES ('616', '575', '25', '12', '37', '2012-07-05 10:46:46', '2012-07-05 10:46:46', '2012-07-05 10:59:29', 'concluido', 'alega q alugou uma pequena edicula nos fundos de sua casa p/ a requerida Eva Leão Cordoba no mes de maio pp., mas antes de assinar o contrato, a mesma ingressou no imóvel por conta da autora estar internada; q a locatária tem feito exigencias descabidas como calçar o quintal, vinculando tal exigencia p/ pagar os alugueis; q apos a resposta negativa da autora, a locataria passou a maltratar a autora, q é pessoa idosa e doente, causando estresse; q pretende a desocupação do imóvel (alega q pediu o final de consumo da agua e energia q está em nome da autora p/ forçar a saida desta); enviei oficio intimando a locataria a comparecer na data de 17/07/12 p/ tentar acordo \r\n\r\nAssistida já possui Ação de Indenização por Danos Materiais e Morais ajuizada em face das Lojas Marisa, em trâmite perante a 8ª Vara Cível - aproveitou-se para informá-la da audiência de instrução e julgamento já designada.', 'sim', '165', '37');
