INSERT INTO `assistencias` VALUES ('630', '595', '2', '11', '34', '2012-07-09 06:58:27', '2012-07-09 06:58:27', '2012-07-09 08:33:42', 'concluido', '09.07.12 - após lido, disse que concorda com o laudo de fls.683 e ss, mas que teria condições de pagar somente R$ 10.000,00 (dez mil reais) para a quitação do imóvel, oferecendo proposta de pagamento nesse sentido; trouxe o recibo de pagamento dos meses de abril, maio e junho que pagou (e ainda não constam dos autos); diz teve sua casa assaltada e acresceu ao imóvel para fim de torná-lo mais seguro grade de ferro nas portas da sala e da cozinha, cadeados, portão eletrônico, e aumentou a altura do muro (para ficar rente ao portão eletrônico), com aproximadamente R$ 6.000,00, tendo comprometido consideravelmente sua renda, motivo pelo qual não possui condições de oferecer proposta maior de pagamento. Celso Firmino, RG 4828892/5 SSP/SP, CPF: 922851398/53.', 'sim', '169', '35');
