INSERT INTO `assistencias` VALUES ('632', '596', '1', '41', '5', '2012-07-09 07:00:09', '2012-07-09 07:00:09', '2012-07-09 08:02:18', 'concluido', '09/07/2012 - Compareceu a assistida à DPE alegando necessitar se submeter a procedimento cirúrgico na coluna. Conforme exames médicos anexos, a assistida apresente discopatia degenerativa L5-S1 (desidratação discal); Espondilolistese L5-S1 de grau II, causando protrusão discal posterior difusa relativa com compressão do saco dural e redução de dimensões dos foramens intervertebrais bilateralmente, podendo corresponder à área de compreensão radicular; Espondiloartrose lombar; alterações degenerativas das placas terminais dos corpos vertebrais L5 e S1 (modic 1). Não tem negativa do Estado e nem do Município. Orientada a trazer negativa para ajuizamento da ação.', 'nao', '715', '6');
