INSERT INTO `assistencias` VALUES ('649', '610', '23', '21', '41', '2012-07-09 07:14:28', '2012-07-09 07:14:28', '2012-07-09 09:36:32', 'concluido', 'Representa a esposa DEUZDELIA MORAIS DE AGUIAR, que é portadora de Neoplasia Maligna de mama direita; vem sendo tratada com quimioterapia,  tendo sido submetida a 04 sessões e foram solicitadas mais 02, com uso de Herceptin e Taxotere (Taxano). \r\nA família levou o pedido médico e recebeu informação de que a CASSEMS não iria cobrir o medicamento com base em parecer de sua auditoria médica, que atestou que a associação não teria indicação técnica.\r\nA médica assistente  forneceu laudo instruído com bibliografia médica no sentido de haver indicação técnica para o tratamento indicado, mas mesmo assim persistiu a recusa.\r\nPela programação a próxima dose (5º ciclo) deverá ser dada no dia 12/07/2012. \r\nExpedi ofício solicitando à empresa que reavalie o caso, considerando a gravidade do estado da paciente e do risco a que está exposta se houver retardamento do tratamento, de modo a ser autorizado o tratamento indicado pelo médico assistente.\r\n', 'nao', '474', '41');
