INSERT INTO `assistencias` VALUES ('667', '629', '23', '66', '3', '2012-07-09 07:27:40', '2012-07-09 07:27:40', '2012-07-09 10:09:01', 'concluido', 'Adelia Ferreira dos Santos compareceu na Defensoria em 06/06/2012, pleiteando vaga em creche para os dois filhos Allan Carlos e Pedro Antonio, encaminhamos um Oficio para o CEinf Jasmim Ibrahim Bacha que fica perto de sua residência no Bairro Nova Lima. No entanto, a vaga do Allan Carlos foi para o Ceinf pleiteado, e a vaga do Pedro Antonio no Bairro Jardim Columbia no Ceinf Michel Sacaff, esse bairro fica distante de sua residência, a genitora dos menores entra no serviço 07:00 horas da manhã. Solicita vaga no Ceinf perto de sua residência. Encaminharemos Ofício para o Semed. ', 'nao', '721', '4');
INSERT INTO `assistencias` VALUES ('668', '630', '1', '45', '5', '2012-07-09 07:28:10', '2012-07-09 07:28:10', '2012-07-09 08:03:06', 'concluido', 'Foi policial militar do Bombeiro. Foi transferido para reserva remunerada em 1996. Já era soldado. Tempo de serviço 30 anos 5 meses e 18 dias. Aposentou como soldo de cabo, sem promoção. Na época, com 10 anos seria cabo, 25 anos terceiro sargento e, em caso de reforma, iria para segundo sargento. Quer revisar. Pedido de cópia das legislações da época (Lei Complementar 053/90 e, se tiver, outras) e atual para análise. Após, retornar. ', 'sim', '478', '5');
