INSERT INTO `assistencias` VALUES ('677', '639', '33', '25', '32', '2012-07-09 07:36:48', '2012-07-09 07:36:48', '2012-07-09 09:40:49', 'concluido', 'Assistido buscou atendimento, porque ficou \"cuidando\" de um terreno para o proprietário. Ocorre que este morreu e ele quer sabe se tem direito ao terreno. ORIENTADO acerca da necessidade dos 10 anos de posse manda, ininterrupta e pacífica com \"animus domini\".', 'nao', '486', '33');
