INSERT INTO `assistencias` VALUES ('681', '640', '1', '57', '47', '2012-07-09 07:40:10', '2012-07-09 07:40:10', '2012-07-09 09:31:39', 'concluido', 'que, embora tivesse promovido reclamação já em fase de cumprimento de sentença na 10ª VJEC, não conseguiu incluir lá pedido para evitar cobranças abusivas que o Banco Santander continua fazendo em sua conta bancária, já que aquele juizo entende que determinadas prestações refogem daquela demanda, devendo ora ingressar com nova ação. Aguarda obtenção de cópias do processo sob a competência do DPE daquela Vara para elaboração de nova inicial. ', 'nao', '185', '47');
