INSERT INTO `assistencias` VALUES ('683', '645', '2', '5', '34', '2012-07-09 07:41:28', '2012-07-09 07:41:28', '2012-07-09 09:19:52', 'concluido', '09.07.12 - ação nova - compareceu dizendo que deseja ajuizar ação de Reparação de Danos contra Ferreira Materiais para Construção LTDA-ME, eis que um caminhão (placas KPE3314 - Brasilândia - MS) que estava descarregando cargas da empresa requerida no seu vizinho, aos 13/03/2012, aproximadamente às 16:00, colidiu parte da frente do muro de sua residência, no momento da manobra; já houve tentativa de acordo amigavelmente e no juizado especial (autos n. 0000338-26.2012) sem sucesso; requer o recebimento de R$ 1522,78 (mil quinhentos e vinte e dois reais e setenta e oito centavos) para reparar os danos causados no muro, conforme cópia dos orçamentos; alega que a empresa requerida quer somente reparar o dano visível do muro, ou seja, a marca deixada pela colisão, mas que os danos causados não se limitam a tais danos, eis que seu muro sofreu danos em sua estrutura e edificação (danificou a base do muro com o impacto). Rol de testemunhas: Celso Antônio de Oliveira Júnior, Rua pontalina, n. 103, casa 02, fundos; e Rosangêla Maria Gomes de Araújo, Rua Fernando de Fonseca, n. 419, jardim tropical (informante).  MANOEL GOMES DE ARAÚJO, RG 5989798 SSP/SP, CPF 389931988-53.', 'sim', '487', '35');
