INSERT INTO `assistencias` VALUES ('691', '653', '20', '20', '34', '2012-07-09 07:46:12', '2012-07-10 08:21:58', '2012-07-10 09:47:47', 'concluido', '09.07.12 - compareceu alegando que com relação aos autos n. 0028115-04.2012, seu nome foi excluído do serasa, mas não do CPC e da CCF; o processo está em prazo para contestação da requerida; se compromete a retornar com comprovante de que seu nome ainda está incluído no SPC e no CCF, e com cópia integral dos autos, eis que não podemos ter vista. Diz que está com muita pressa para ter seu nome limpo, eis que encontra-se desempregado e na iminência de perder uma proposta de trabalho por contada negativação. JOANIL MASSISTER BENITES, RG 000606244, CPF 891225851-68.\r\n09.07.12 - trouxe comprovante de negativação para fazermos pedido de ofício ao bacen e banco abn real (atual santander). \r\n10.07.12 - petição avulsa protocolada.', 'nao', '571', '34');
