INSERT INTO `assistencias` VALUES ('696', '657', '23', '25', '34', '2012-07-09 07:50:38', '2012-07-09 07:50:38', '2012-07-09 09:24:55', 'concluido', '09.07.12 - Compareceu relatando que fez consórcio com a consórcio yamaha motor, através do vendedor Vitor. Diz que pretende a restituição dos valores pagos. Questionado sobre o valor pago, devido ao preenchimento do contrato, por estar ilegível, o assistido não soube dizer o mês exato do pagamento. Foi expedido ofício, entregue para o assistido, solicitando informações of.58-12.', 'nao', '493', '34');
INSERT INTO `assistencias` VALUES ('697', '659', '2', '25', '47', '2012-07-09 07:51:21', '2012-07-09 07:51:21', '2012-07-09 10:12:18', 'concluido', 'que, faz um ano, aderiu a um grupo de consórcio de um veiculo motocicleta, desistindo após pagamento de entrada e duas parcelas. Orientada que as decisões judiciais são para restituição dos valores após o final do grupo. ', 'nao', '494', '47');
