INSERT INTO `assistencias` VALUES ('700', '662', '2', '8', '23', '2012-07-09 07:54:42', '2012-07-09 07:54:42', '2012-07-09 08:51:19', 'concluido', '09/07/12 - divorciada, auxiliar de cozinha, 1carro quitado (ano 2007, renda mensal R$ 945,00 e pensão alimentícia do filho (R$ 235,00). Tem um imóvel em nome do filho e quer vende-lo, para adquirir outro imóvel, através do financiamento da CEF. Informado que o pedido provavelmente será indeferido, já que não se trata de imóvel quitado, e sim financiado, sendo que o que possui, encontra-se quitado. Irá verificar e tratá docs caso resolva ingressar com ação judicial.', 'nao', '235', '23');
INSERT INTO `assistencias` VALUES ('701', '663', '1', '14', '19', '2012-07-09 07:55:00', '2012-07-09 07:55:00', '2012-07-09 08:45:24', 'concluido', null, 'nao', '497', '19');
INSERT INTO `assistencias` VALUES ('702', '666', '2', '25', '21', '2012-07-09 07:56:12', '2012-07-09 07:56:12', '2012-07-09 08:43:02', 'concluido', '09/07/2012 - a assistida adquiriu um veículo junto a concessionária Fiat Enzo, mas a concessionária entregou outro véiculo, ou seja, não foi o adquirido que era completo. sugerido fazer uma perícia extrajudicial para aferir a exatidão e se realmente há defeito na colocação dos vidros e travas.', 'nao', '500', '21');
INSERT INTO `assistencias` VALUES ('703', '664', '33', '11', '32', '2012-07-09 07:56:36', '2012-07-09 07:56:36', '2012-07-09 09:48:46', 'concluido', 'Contrato bancário - cédula de crédito comercial. Revisão de juros, porém dentro dos parâmetros legais.', 'nao', '501', '32');
INSERT INTO `assistencias` VALUES ('704', '665', '2', '25', '37', '2012-07-09 07:57:12', '2012-07-09 07:57:12', '2012-07-09 09:25:59', 'concluido', 'ORIENTAÇÃO  s/ imóvel vendido p/ tio em prestações e não pagas; o contrato particular tem como vendedores a assistida e s/ ex-marido; a assistida não mora nesta cidade e quer orientação p/ ver como fazer p/ ingressar c/ ação - sugeri q outorgasse procuração p/ pessoa de s/ confiança', 'nao', '498', '37');
INSERT INTO `assistencias` VALUES ('705', '667', '33', '70', '32', '2012-07-09 07:57:24', '2012-07-09 07:57:24', '2012-07-09 10:24:47', 'concluido', 'Revisão de juros bancários. Providenciará pedido extrajudicial diretamente ao banco.', 'nao', '496', '32');
INSERT INTO `assistencias` VALUES ('706', '668', '1', '51', '27', '2012-07-09 07:58:08', '2012-07-09 07:58:08', '2012-07-09 09:40:50', 'concluido', '09/07 Sentença reconhecendo prescrição de cumprimento ajuizado em abril deste ano. O TJ reitera esse entendimento em agravo. Informei que é possivel pelo Juizado, assinando a ciencia daquela sentença e a expressa vontade de ajuizamento novamente. Pedi que traga cálculo para devolução das 17 parcelas que pagou, embora tenha apenas o comprovante de dois pagamentos.\r\nRetorna com o cálculo', 'nao', '502', '27');
INSERT INTO `assistencias` VALUES ('707', '276', '1', '21', '3', '2012-07-09 08:00:36', '2012-07-09 08:00:36', '2012-07-09 11:20:52', 'concluido', 'Sr. ALONSO CORREA FERREIRA sofreu um acidente automobilístico em 1955, onde fraturou a perna direita, oportunidade em que foi operado na Santa Casa desta Capital, 06 dias depois foi operado novamente para colocar uma platina, quando retiraram o gesso machucaram seu calcanhar. Há 04 anos atrás começou a sair um líquido do seu calcanhar (na cicatrtiz do gesso). Em abril do corrente ano o Sr. Alonso foi novamente operado pela Dra. Maria Helena, na Santa Casa porque segundo a médica a ferida não cicatrizava, após três dias da operação seu pé infeccionou, causando mal cheiro, relata o Autor que havia pego infecção bacteriana no Hospital. Continua tomando antibióticos e a ferida ainda está aberta. Em 17.07.2012 está agendado uma nova cirurgia com o cirurgião Dr. Maksoud para fazer enxerto no seu calcanhar. Pleiteia indenização pelos danos (morais e materiais) sofridos em razão de ter gasto com medicamnetos, consultas e por ter pego infecção. é dependende do plano de sáude de sua esposa Cassems. Aguardando retornar com os documentos para ajuizar ação.', 'sim', '188', '4');
INSERT INTO `assistencias` VALUES ('708', '670', '1', '25', '27', '2012-07-09 08:00:53', '2012-07-09 08:00:53', '2012-07-09 10:51:23', 'concluido', '09/07 orientação erro médico cirurgia - colocação de prótese - infecção hospitalar, há sete meses sendo tratada e sem resultado no restabelecimento da saúde. Orientei para trazer os docs médicos com laudo e internação hospitalar. Retorno em aberto', 'nao', '506', '27');
INSERT INTO `assistencias` VALUES ('709', '672', '33', '25', '15', '2012-07-09 08:02:00', '2012-07-09 08:02:00', '2012-07-09 08:40:02', 'concluido', null, 'nao', '236', '16');
INSERT INTO `assistencias` VALUES ('710', '671', '33', '48', '9', '2012-07-09 08:02:16', '2012-07-09 09:27:26', '2012-07-09 10:10:58', 'concluido', 'Execução fiscal municipal em andamento. Encaminhado para a Dra. Zeliana.\r\nCitação em execução Fiscal - ISS - foi orientada a retornar apos a penhora. também foi orientada (com oficio) a ir até a Prefeitura para requerer a suspensão da inscrição e o cancelamento da divida.', 'sim', '010', '9');
