INSERT INTO `assistencias` VALUES ('717', '678', '4', '12', '37', '2012-07-09 08:07:32', '2012-07-09 08:07:32', '2012-07-09 09:49:15', 'concluido', '8ª vara ação de despejo p/ falta de pagamento - pretende a contestação - pedir vista dos autos; RETORNO em 09/07/2012 - alega q desocupou no dia 05/09/2012 e já entregou as chaves no dia 09/09/2012; \r\nRETORNO - p/ assinar contestação e esclarecer acerca do valor dado em caução', 'nao', '507', '37');
INSERT INTO `assistencias` VALUES ('718', '680', '2', '70', '23', '2012-07-09 08:08:12', '2012-07-09 08:08:12', '2012-07-09 09:46:38', 'concluido', '09/07/12 - casado, represenante comercial, ela do lar, 1 casa quitada, renda mensal R$ 2.200,00. Tem diversos débitos no Banco Bradesco, que fez proposta para agrupar todos os débitos, com garantia do imóvel residencial. Orientado a não realizar o agrupamento, eis que caso não consiga cumprir o acordo, o imóvel poderá ser vendido para sua quitação. Trará todos os contratos e extrato dos débitos para análise, e, caso seja necessário, propor ação de consignação em pagamento  somente do contrato que já deu em garantia o imóvel residencial, deixando os demais sem o pagamento.', 'nao', '510', '23');
INSERT INTO `assistencias` VALUES ('719', '679', '2', '61', '19', '2012-07-09 08:08:31', '2012-07-09 08:08:31', '2012-07-09 09:55:12', 'concluido', 'Foi encaminhado a outro Defensor, pois quer orientação acerca do seu processo.', 'nao', '509', '19');
INSERT INTO `assistencias` VALUES ('720', '681', '1', '56', '47', '2012-07-09 08:09:10', '2012-07-09 08:09:10', '2012-07-09 08:58:32', 'concluido', 'Que desde 1980, quando acidentou no trabalho, passou a receber auxilio doença, que nunca foi interrompido, recebendo até hoje.Ocorre que, a quantia atual é irrisória, recebendo R$ 125,00 por mês, pretendendo revisão ou conversão em aposentadoria/indenização por invalidez, já que perdeu a ponta dos dedos da mão direita. \r\nAguardando retorno com laudo médico demonstrando sua incapacidade parcial. \r\n\r\n', 'nao', '511', '48');
INSERT INTO `assistencias` VALUES ('721', '682', '1', '11', '47', '2012-07-09 08:09:33', '2012-07-09 08:09:33', '2012-07-09 11:01:05', 'concluido', null, 'nao', '512', '47');
