INSERT INTO `assistencias` VALUES ('724', '685', '9', '15', '32', '2012-07-09 08:13:40', '2012-07-09 08:13:40', '2012-07-09 10:17:14', 'concluido', 'No inventário 0011481-35.2009.8.12.0001 o juiz não reconheceu a pretensão aquisitiva pelo tempo, pedindo para ajuizarmos ação própria (usucapião). Assinaram Declaração de Hipossuficiência para propositura de ação de USUCAPIÃO.', 'nao', '191', '33');
