INSERT INTO `assistencias` VALUES ('761', '703', '27', '23', '15', '2012-07-09 08:55:24', '2012-07-09 08:55:24', '2012-07-09 10:34:34', 'concluido', 'que, em novembro/2004, financiou e tomou posse do imóvel sito à Rua Nizia Floresta, lote 13 da quadra 02 do Vida Nova III, junto a EMHA. Em junho/2005, o seu companheiro passou a risidir no imóvel juntamente com a mesma. Um ano após, junho/2006, a assistida teve um desentendimento com o companheiro, saiu de lá para morar com o seu filho na esperança de entrar num acordo com o mesmo que na ocasião exigia o ressarcimento do valor que investiu numa obra de construção de uma edícula (dois cômodos), no fundo do lote.  \r\nTendo em vista a contenda típica de família, encaminho à DPE competente presente neste edifício. ', 'sim', '04', '47');
