INSERT INTO `assistencias` VALUES ('770', '728', '1', '39', '5', '2012-07-09 09:02:59', '2012-07-09 09:02:59', '2012-07-09 09:27:10', 'concluido', '09/07/2012 - Compareceu a assistida à DPE, alegando estar gestante de 03 meses. Que sua gravidez é de alto risco, razão porque o médico, Dr. Wilson Ayach (CRM/MS 2360), prescreveu o medicamento CLEXANE. A assistida necessita fazer o uso do medicamento durante toda a gestação e mais 45 dias após. Foi orientada a trazer negativa do Estado e do Município para, se for o caso, ajuizamento da ação. A assistida é do lar. O sustento da família é garantido pelo trabalho do marido, que é serralheiro, auferindo em torno de R$ 800,00. Aguardar retorno.', 'sim', '008', '6');
INSERT INTO `assistencias` VALUES ('771', '729', '25', '25', '21', '2012-07-09 09:04:20', '2012-07-09 09:04:20', '2012-07-09 09:48:32', 'concluido', '09/07/2012 - orientação sobre compra e venda de veículo financiado - obs. marcada audiência para 11/07 - 10 horas, para tentar acordo. a assistida levou intimação para a parte contrária(adquirente do veículo). ', 'sim', '527', '21');
INSERT INTO `assistencias` VALUES ('772', '730', '24', '25', '27', '2012-07-09 09:06:12', '2012-07-09 09:06:12', '2012-07-09 10:20:39', 'concluido', '09/07 Há ação por advogado - Dr. Carlos Eduardo - agora Juiz que está substituindo em Rio Brilhante - em face da Imansul, que tem precatório perante o TJ, infomei que foi enviado para a Coordenação de pagamento, mas que deve ter renuncia dos advogados para TER ATENDIMENTO PELA DP DE 2ª INSTÃNCIA, unica que pode peticionar perante o TJ. Veio com indicação do Dr. Miguel Vieira Procurador MP e da Drª Senise do Estado. Não sei porque encaminhado para mim como primeiro caso. ', 'sim', '528', '27');
