INSERT INTO `assistencias` VALUES ('789', '746', '2', '25', '34', '2012-07-09 09:38:22', '2012-07-09 09:38:22', '2012-07-09 11:16:50', 'concluido', '09.07.12 - quer orientação - compareceu juntamente com a esposa Maria Sandra dos Santos, alegando que exercia função de zelador na chácara e na escola de sua patroa; que em setembro de 2011 estava lavando o vidro da janela da escola, que estava quebrada, momento no qual o vidro caiu e cortou o tendão da mão direita do declarante; em razão do acidente acabou tendo que amputar um dedo da mão direita (dedo do meio); que trabalha com carteira assinada pela pessoa física Carmem Zem Rodriguez; foram no INSS e lá não constava o nome do declarante como empregado registrado; que em novembro de 2011 a patroa Carmem pediu ao declarante a carteira de trabalho do mesmo para regularizar sua situação junto ao INSS e até o momento não devolveu a carteira de trabalho do declarante; quer orientação a respeito da retenção de sua carteira de trabalho, e da possibilidade de pedir indenização pelo membro perdido em razão de acidente ocorrido no ambiente e na função do trabalho; desconhecem a realização de DAT; que ainda hoje foi na contadora da patroa, onde foi informado que estão apenas no aguardo de alguns documentos para regularização quanto ao INSS para que o declarante receba os benefícios devidos; que não sabem se é verdade que a patroa está regularizando a situação; que continua recebendo remuneração da patroa; foi orientado que com relação a indenização tanto material quanto moral que envolva relação de trabalho, deve ser ajuizada na Justiça do Trabalho; e que com relação a retenção da CTPS, pode ser pedido a busca e apreñsão da mesma tanto na justiça comum como na justiça do trabalho, sendo que a retenção da CTPS dá ensejo ao pleito de indenização moral na justiça do trabalho caso seja comprovado o efetivo prejuízo por causa da retenção; que com relação ao INSS, a ação deve ser ajuizada na justiça comum, para requerimento de benefícios; em ligação ao INSS (tel: 4009-7631) não foi possível contato em razão de todos já terem saído para almoço; foram entregues jurisprudenciais à respeito das orientações. Foi orientado a retornar na contadora da patroa e tentar pegar a CTPS, bem como a cópia de todo procedimento tomado para regularização da situação do empregado junto ao INSS; pegar e trazer ao menos a cópia da CTP do declarante; trazer laudos médicos da situação do declarante, tudo amanhã, quando novamente tentaremos contato com o INSS para obtermos informações a respeito da situação do CAD do declarante.\r\nAERIOMAR PAIXÃO, RG 54329 SSP/RO, CPF 350871962-68.', 'nao', '531', '35');
