INSERT INTO `assistencias` VALUES ('824', '781', '1', '15', '47', '2012-07-10 07:07:13', '2012-07-10 07:07:13', '2012-07-10 10:23:11', 'concluido', 'que, aprox no ano de 1989, adquiriu os direitos e obrigações da vendedora e possuidora anterior do imóvel Sra. (...), que não se recorda o nome dela agora, para quem quitou o valor conbinado. Tal imóvel era financiado junto a COHAB. Não se recorda o valor pago, tendo inclusive extraviado o contrato particular. Efetuou o pagamento integral das prestações vincendas do financiamento, que foi quitado há mais de 10 anos, cf. comprovantes de pagamentos, não conseguindo o respectivo termo de quitação por não se encontrar em seu nome. \r\nAguarda PROVIDENCIAR DOCS (rol em anexo)', 'nao', '546', '47');
INSERT INTO `assistencias` VALUES ('825', '783', '19', '13', '32', '2012-07-10 07:07:52', '2012-07-10 07:07:52', '2012-07-10 11:18:54', 'concluido', 'Foi citado para contestar ação de reintegração de posse c.c reparação de danos em trâmite na 9ª Vara cível sob o nº 0030854-47.2012.8.12.0001. Argumenta que cuidou do imóvel por um determinado período, pois, segundo informações do assistido o imóvel encontrava-se: \"abandonado e com mato alto, lixo, com muitas folhas e frutos dos pés de manga no chão sendo fonte de mosquitos\". A mãe do assistido é vizinha de muro do imóvel em questão e teve informação pelo agente comunitário de saúde acerca das péssimas condições do imóvel, chegando a noticiar possível comunicação à Prefeitura Municipal para multar o proprietário. Vendo essa situação, o assistido resolveu cuidar do imóvel limpando-o e mantendo-o em melhores condições, até mesmo para resguardar a saúde de sua mãe que conta com 74 anos de idade. Após reconciliar-se com sua companheira retornou para sua casa no início do ano de 2011.', 'nao', '733', '33');
