INSERT INTO `assistencias` VALUES ('835', '792', '23', '21', '5', '2012-07-10 07:16:25', '2012-07-10 07:16:25', '2012-07-10 08:35:06', 'concluido', '10/07/2012 - Compareceu a assistida à DPE, alegando que concluiu o ensino médio na Escola Municipal de Ensino Fundamental Cachoeira da Serra, no Município de Altamira-PA, anexa à escola Prof. Nair de Nazaré Lemos, localizada na Rua da Concórdia, S/N, telefone (93) 5154-4005. Informa que, depois de ter concluído o ensino médio, mudou-se para a cidade de Campo Grande-MS juntamente com sua irmã, Tainara Paula Teixeira de Quadros. Afirma que prestou concurso vestibular na Universidade Anhanguera Uniderp, logrando aprovação para o curso de Engenharia Civil, com início das aulas em agosto de 2012. Por ocasião da matrícula, foi informada de que teria o prazo de dois dias para apresentar o MODELO 19, documento que não portava na oportunidade. Diante disto, entrou em contato com a escola em que concluiu o ensino médio, quando então descobriu que não era possível a emissão do MODELO 19 em razão de não possuir nota da disciplina de matemática referente à primeira série do ensino fundamental, cursada na Escola Municipal Daniel Titton, localizada na Rua Pedro Celestino, S/N, CEP 78.540-000, na cidade de Claudia-MT, telefone (66) 3546-1266. Que entrou em contato com esta última escola, sendo informada de que a nota de Matemática era emitida juntamente com a nota de Português, conforme método de ensino adotado à época. Ocorre que a Escola Nair de Nazaré Lemos, mesmo depois de cientificada dessa situação, nega-se a expedir o MODELO 19 sem que lhe seja apresentada a nota de matemática da primeira série do ensino fundamental ou observação.Providências: Ofício requisitório às escolas acima.', 'nao', '736', '5');
