INSERT INTO `assistencias` VALUES ('871', '827', '19', '55', '47', '2012-07-10 07:45:36', '2012-07-10 07:45:36', '2012-07-10 09:29:02', 'concluido', 'que, trata-se de confinante citada na ação de usucapião, que nessa condição nada tem a opor. No entanto, admite que reside no lote 09 da quadra 05 do Jd. Campo Novo, confrontante com o lote usucapiendo, desde 1982. Na ocasião, já ficou sabendo que o proprietário do lote usucapiendo é de propriedade do Sr. ANTONIO ARANTES DA SILVA. Desde então, o Sr. Antonio solicitou ao confinante que cuidasse do imóvel, o que foi aceito mediante a consessão do imóvel para ser utilizado para plantação de hortaliças e outras plantas rotativas (mandioca, milho, abobora quiabo etc). Além disso, foi plantada 3 pés de magueiras, 2 pés de abacateiros, 1 pé de camisa fina (árvora silvestre).  Esclarece que sempre avistava tal pessoa presente no imóvel, que lá ia fzer seus cuidados básicos de limpeza e vigilância. O confinante esclarece que deixou de utilizar o imóvel para plantação já faz cerca de 2 anos porque a terra já não produzia suficientemente, pelo fato da terra ter ficado muito dura. \r\n Esclarece também que, em janeiro/2011, a pedido do topógrafo Sr. José (...) da empresa ENGEPAR, o imóvel foi cedida à título de comodato verbal para instalação de um escritório provisório e estacionamento de máquinas pesadas, a qual desocupou o imóvel em aprox outubro/2011. Na ocasião, o confinante inclusive cedeu água encanada do seu imóvel para servir o dito escritório, cuja despesa foi dividida. \r\nPROVIDENCIAR: 1 - nome completo e endereço do topógrafo; 2 - e ver se ele tem documento que comprova a instalação ou a permanência da empresa no local.\r\n', 'sim', '034', '47');
INSERT INTO `assistencias` VALUES ('872', '829', '2', '29', '27', '2012-07-10 07:45:55', '2012-07-10 07:45:55', '2012-07-10 08:55:32', 'concluido', '10/07 - Dispensei a assistida com proc no Juizado - execução de dois cheques de r$500,00 e R$680,00 por serviços de marcenaria. Reside em casa própria. Vive do rendimento de dois aluguéis, embora diga que não tem dinheiro, pois residiu no exterior por 10 anos, teve comércio - loja de roupas - agora separada do marido que tem rendimento de aluguel no valor de R$3.000,00 mais um comércio. os exteriores, semi jóias, acessórios - de griffè - vestimenta e veículo que não tem no próprio nome evidenciam o requisito de NÃO ASSISTIDA DA DP. Dei informações até sobre pensão alimenticia, mas recomendei o pagamento, tem metade do valor e negociar o restante do pagamento no proprio juizado.', 'nao', '743', '27');
