INSERT INTO `assistencias` VALUES ('910', '778', '23', '33', '5', '2012-07-10 08:19:20', '2012-07-10 08:19:20', '2012-07-10 09:16:02', 'concluido', '10/07/2012 - Compareceu o assistido à DPE, alegando estar com seu nome grafado erroneamente na certidão de casamento. Apresentou documento de identidade e RG que comprovam o erro de grafia, estando escrito DERLY RAMON LOPEZ, sendo que o correto é DERLY RAMÃO LOPES. Não trouxe certidão de nascimento. Tem conhecimento de que a certidão de nascimento é do Cartório de Registro Civil da cidade de Porto Murtinho. Expedição de ofício ao Cartório de Registro Civil de Porto Murtinho requisitando segunda via de certidão de nascimento. Aguardar resposta para, se for o caso, ajuizar ação.\r\nTelefone para contato: 3317-8764', 'sim', '020', '5');
