INSERT INTO `assistencias` VALUES ('917', '870', '33', '25', '34', '2012-07-10 08:25:05', '2012-07-10 08:25:05', '2012-07-10 10:13:35', 'concluido', '10.07.12 - Relata que emprestou seu nome e o do seu marido hélio rondom de souza para o seu irmão, para abrir uma empresa, o qual fez dois empréstimos no Banco. Relata que foram notificados pelo Banco. Foram orientados a promoverem a baixa da empresa, ou ainda a procurarem o seu irmão para promoverem a alteração contratual com a exclusão de seus nomes da empresa. A respeito do empréstimo, não sabem dizer que assinaram como devedores solidários, tendo sido orientados a providenciarem a cópia do contrato do empréstimo para análise, e a certidão da jucems.', 'nao', '573', '34');
