INSERT INTO `assistencias` VALUES ('925', '879', '1', '15', '47', '2012-07-10 08:31:31', '2012-07-10 08:31:31', '2012-07-10 11:13:00', 'concluido', 'que, há cerca de 30 anos, sua genitora tomou posse do imóvel lote 04 da quadra 09 do Jd. Aero Rancho, tendo em vista que o imóvel encontrava-se abandonado. Na ocasião, construiu uma edícula de madeira, vindo em seguida a substitui-la por uma de alvenaria, ora composta de 2 quartos, sala, cozinha e banheiro. E construiu no fundo uma edícula. Que sua genitora faleceu faz cerca de 4 anos. Que deixou 9 filhos, dos quais 2 ainda residem com a assistida, sendo uma incapaz da qual é curadora. Ofício expedido ao CRI (matrículas). \r\nAguarda retorno com demais docs. ', 'nao', '580', '47');
INSERT INTO `assistencias` VALUES ('926', '791', '20', '5', '34', '2012-07-10 08:31:36', '2012-07-10 08:31:36', '2012-07-10 10:18:20', 'concluido', '10.07.12 - compareceu para prestar esclarecimentos sobre os fatos ocorridos, para fins de contestar a ação n. 0022656-21.2012.8.12.0001: Que estava na direção do veículo Ford Ka de propriedade de sua mãe; que vinha pela rua ezequiel ferreira lima no sentido leste/oeste; que parou nesta rua, antes do cruzamento com a rua arapoti, para verificar se vinha algum veículo, e iniciar a conversão para a esquerda; que após ter parado e ligado a seta que indicava sua intenção, e ter verificado que não vinha nenhum veículo, iniciou a conversão para esquerda; que derrepente, quando o declarante havia recém começado a conversão, eis que surge a moto do autor; com farol baixo e em alta velocidade, de modo que o declarante interrompeu a conversão; contudo, não houve meio de impedir-se a colisão; que a moto colidiu com a parte frontal direita do veículo que o declarante dirigia, e devido ao impacto e o susto com a situação, o declarante acabou acelerando o veículo que acabou indo parar na rua arapoti, na contra-mão; que caso a moto do autor estivesse em velocidade compatível com a via, provavelmente a colisão poderia ser impedida; que o formato da via ezequiel ferreira lima colaborou para a colisão, eis que o trecho no qual a moto vinha, é muito estreito devido ao parque que fica da esquina da rua ezequiel e da rua arapoti; que o croqui de fls. 33 não demonstra com clareza essa discrepância entre a largura da via no trecho que fica frente ao parque, e o trecho no qual o declarante vinha; que o trecho da via que vinha o declarante é bem mais largo do que o trecho percorrido pelo autor, de maneira que a mão (do lado sul) da rua ezequiel, praticamente dá de encontro com a mão (lado norte) da mesma via; que portal motivo, a moto do autor acertou o lado direito frontal do declarante, enquanto este recém tinha iniciado e, logo em seguida, interrompido a conversão; que estavam na moto conduzida pelo autor, o autor com sua esposa e a filha, de aproximadamente 5 anos; que estas nada sofreram, e que o autor sofreu apenas um corte na perna; que após a colisão não parecida que a lesão do autor era grave (o mesmo ficou andando até chegar o SAMU); que o SAMU chegou e levou o autor para o hospital; que na ocasião a mulher do autor, e também passageira da moto, informou que o mesmo não possuía habilitação (CNH); logo após o acidente o autor manifestou que não queria que fosse chamado a polícia, eis que assumia sua culpa, e pretendia resolver tudo amigavelmente, mediante acordo (queria que cada um pagasse os danos de seu próprio veículo); que o declarante chamou sua mãe no local, que não aceitou o referido acordo, chamando a polícia; que quando a polícia chegou, verificou-se que realmente o autor não possuía CNH; que após uma semana do acidente, o autor foi até a casa do declarante, andando normalmente, em bom estado de saúde, dizendo que havia sido demitido do emprego, requerendo a quantia de R$ 200,00 por semana; a genitora do declarante (também requerida) disse que não iria pagar referido valor ao autor; que ligou, juntamente com sua mulher, várias vezes para a genitora do declarante pedindo dinheiro, e dizendo que passavam por necessidades financeiras; a genitora do declarante trabalha no frigorífico JBS, no setor de triparia, auferindo valor irrisório; o declarante está desempregado e auxilia nos cuidados de seu irmão que é deficiente físico e mental, a fim de permitir que sua mãe trabalhe; o declarante vive juntamente com sua genitora, seus dois irmãos e sua sobrinha, sendo que sua irmã é mirim, seu irmão e deficiente físico e mental, necessitando de cuidados especiais constantes, e sua sobrinha tem apenas 5 meses de idade. Rol de testemunhas oculares do acidente: a) Aldomar F. de Souza: travessa zenita de nascimento, quadra 112, lote 12, aero rancho IV, celular 9922-9331; b) Rafael de Oliveira Leque: Rua Antonio Dornelas Filho, n. 64, aero rancho III, celular 9180-4443. Eu, Tamara digitei. Adriano Souza Salomão, RG 148219 SEJUSP/MS, CPF: 015.480.231-08. ', 'sim', '548', '35');
