INSERT INTO `assistencias` VALUES ('960', '913', '2', '25', '32', '2012-07-10 09:00:29', '2012-07-10 09:00:29', '2012-07-10 10:38:54', 'concluido', '10.07.2012 - Está com problemas de inscrição na matrícula do imóvel, pois o vizinho cujo imóvel é em condomínio com o da assistida alega que ela está invadindo seu terreno. Orientada a procurar SEMADUR para que esclareça quem está com as medidas erradas.', 'sim', '063', '33');
INSERT INTO `assistencias` VALUES ('961', '911', '20', '51', '37', '2012-07-10 09:00:32', '2012-07-10 09:00:32', '2012-07-10 10:42:42', 'concluido', 'cumprimento de sentença - intimada p/ pagamento - efetuei proposta p/ pagar em 24 x de R$ 190,00 atraves de petição encam ao juizo da 8ª vara civel', 'nao', '408', '37');
INSERT INTO `assistencias` VALUES ('962', '912', '2', '11', '23', '2012-07-10 09:00:49', '2012-07-10 09:00:49', '2012-07-10 09:55:17', 'concluido', '10/07/2012 - solteira, operadora de caixa, possui 1 casa quitada, tem renda mensal de R$ 720,00. O filho adquiriu um veículo na garagem, fez financiamento junto ao Banco Votorantim. O veículo apresentou alguns problemas de suspensão, que deveria ser verificado quando da compra. Alega que o valor do financiamento é muito alto, contudo, não trouxe qualquer documento referente ao contrato. Alega ainda que tinha um consórcio na Honda, que entrou como parte do pagamento, mas também não trouxe documentos. Foi entregue a tabela do BCB referente à taxa média de mercado, para análise dos juros. Caso esteja acima da taxa media retornará para ingressar com ação judicial. ', 'nao', '409', '23');
INSERT INTO `assistencias` VALUES ('963', '914', '20', '29', '41', '2012-07-10 09:04:57', '2012-07-10 09:04:57', '2012-07-10 10:11:28', 'concluido', 'Tem cumprimento de sentença em que figura como devedora (autos nº 0005521-96.2008.8.12.0110/01), houve penhora on-line de sua conta-poupança, porém trata-se de verba alimentar.\r\nDra. Guilherme fez impugnação à penhora, aguardando o juízo apreciar o pedido de levantamento.', 'nao', '407', '42');
INSERT INTO `assistencias` VALUES ('964', '915', '1', '5', '41', '2012-07-10 09:06:35', '2012-07-10 09:06:35', '2012-07-10 11:14:59', 'concluido', 'Acidente havido 25/05/2012 - sexta feira - levado para oficina autorizada da seguradora - guincho foi fornecido - solicitou carro reserva ligando para 0800 - informaram que somente seria liberado após a aprovação do reparo no veículo , o que veio a demorar 05 dias - o recte precisou locar veículo - ao ser finalmente fornecido o veículo reserva teve que pagar o seguro na locadora. \r\nDeseja reparação dos danos', 'nao', '410', '41');
INSERT INTO `assistencias` VALUES ('965', '916', '2', '16', '15', '2012-07-10 09:07:58', '2012-07-10 09:07:58', '2012-07-10 10:20:55', 'concluido', null, 'nao', '411', '16');
INSERT INTO `assistencias` VALUES ('966', '893', '34', '51', '27', '2012-07-10 09:11:26', '2012-07-10 09:11:26', '2012-07-10 09:49:53', 'concluido', '10/07 informei ação nos Difusos e o resultado do julgamento no TJ que deu pela prescrição. Pedi docs e cálculo para ajuizar no Juizado. Retorno com o cálculo. Em vindo deve assinar declaração de desistência daquela e de hipo para propositura no Juizado.', 'nao', '412', '27');
INSERT INTO `assistencias` VALUES ('967', '917', '2', '25', '34', '2012-07-10 09:14:37', '2012-07-10 09:14:37', '2012-07-10 10:44:38', 'concluido', '10.07.12 - CASO NOVO - diz que verificou que seu nome está negativado por causa de uma dívida de R$ 175,00 de julho de 2010 com a empresa Bela Imagem de Campinas-SP; diz que reconhece a dívida, mas que perdeu o contato com a empresa; que também não conseguiu contato mediante o número telefônico fornecido pelo SPC; que pagava o débito mediante carnê; que perdeu o carnê; deseja pagar a dívida (ação de consignação em pagamento); em consulta ao telelistas consegui três números telefônicos: (19) 3251-7786; 3241-8261; 3243-4591. Foi orientado a tentar localizar a empresa, ver se há credibilidade quanto a empresa, e se consegue realizar o pagamento administrativamente, e se não conseguir contato, não conseguir pagar a dívida, ou desconfiar da credibilidade da empresa, para retornar à DPE. (T) REGIS BENITES BARROS; RG 001776401; CPF 028080321-45.', 'nao', '415', '35');
INSERT INTO `assistencias` VALUES ('968', '918', '16', '15', '37', '2012-07-10 09:15:17', '2012-07-10 09:15:17', '2012-07-10 09:38:31', 'concluido', 'Advogado constituído nos autos n. 0127708-50.2005.8.12.0001. Compareceu para extrair cópias dos autos em carga para a defensoria', 'nao', '413', '37');
