INSERT INTO `assistencias` VALUES ('976', '922', '2', '25', '21', '2012-07-10 09:31:48', '2012-07-10 09:31:48', '2012-07-10 09:57:35', 'concluido', '07/10/2012 - o assistido tem advogada constituída nos autos n. 0012157-90.2003 - em trâmite na 16ª vara cível, contra o INSS. Processo em fase de cumprimento de sentença, inclusive. Todavia, orientado a procurar o cartório a fim de saber se foi feito pagamento do precatório.', 'sim', '66', '21');
INSERT INTO `assistencias` VALUES ('977', '923', '26', '5', '32', '2012-07-10 09:32:56', '2012-07-10 09:32:56', '2012-07-10 10:53:30', 'concluido', 'Pensionista do exército. Desconto indevido de parcela de financiamento no contra-cheque. Quer indenização por danos morais. Renda muito acima do limite tolerável para atendimento pela DP. Orientada a procurar o juizado.', 'sim', '416', '32');
INSERT INTO `assistencias` VALUES ('978', '894', '25', '57', '47', '2012-07-10 09:33:06', '2012-07-10 09:33:06', '2012-07-10 10:49:09', 'concluido', 'que, foi fiadora de um empréstimo contraído pelo Sr. Rosalvo Nunes Nogueira, de aquisição de um comprensor, mediante uma linha de crédito de natureza social (para pessoas carentes). Ocorre que, o mutuário pagou apensa 6 prestações, estando em débito com as demais (18) prestações. Além disso, o mesmo transferiu indevidamente o bem a terceiro que está utilizando o bem num lava a jacto de automóvel. Int. dia 16.07.12, as 9h. ', 'sim', '418', '47');
