INSERT INTO `assistencias` VALUES ('987', '930', '1', '11', '39', '2012-07-10 09:44:02', '2012-07-10 09:44:02', '2012-07-10 10:34:11', 'concluido', '10/07/12 - Assistido fez um empréstimo para aquisição de veículo. O \"garagista\" incluiu na valor a ser financiado valor superior ao do bem, ficando com o execesso. Em acordo no PROCON restou devolvido o valor, no entanto queria saber se há abusividade nas taxas do contrato, este que não trouxe no presente dia. Retornará para posterior análise.', 'nao', '420', '40');
INSERT INTO `assistencias` VALUES ('988', '932', '2', '2', '15', '2012-07-10 09:44:33', '2012-07-10 09:44:33', '2012-07-10 11:02:17', 'concluido', null, 'nao', '319', '16');
INSERT INTO `assistencias` VALUES ('989', '933', '32', '68', '2', '2012-07-10 09:45:19', '2012-07-10 09:45:19', '2012-07-10 10:27:22', 'concluido', 'Avô paterno detém a guarda dos netos, a mãe deseja uma modificação somente para solicitar alimentos, tendo em vista que o avô tem um remuneração satisfatória, gerando conflito familiar.', 'sim', '324', '2');
INSERT INTO `assistencias` VALUES ('990', '934', '2', '5', '23', '2012-07-10 09:47:46', '2012-07-10 09:47:46', '2012-07-10 10:02:12', 'concluido', '10/07/2012- divorciada, do lar, sem bens, mora com filho, que é mecânico de máquinas de costura e tem renda aproxiamada de R$ 800,00.\r\nA Assistida foi casada e realizou o divórcio, contudo, não requereu a partilha do imóvel que possuíam juntos. O ex esposo alienou o imóvel há mais de 10 anos, sendo que não é possível a sobrepartilha, já que não o bem não está mais na posse do ex esposo. Ação de ressarcimento de danos encontra-se prescrita.', 'nao', '322', '23');
INSERT INTO `assistencias` VALUES ('991', '936', '20', '16', '27', '2012-07-10 09:49:17', '2012-07-10 09:49:17', '2012-07-10 10:34:28', 'concluido', null, 'sim', '069', '28');
INSERT INTO `assistencias` VALUES ('992', '937', '28', '28', '37', '2012-07-10 09:52:05', '2012-07-10 09:52:05', '2012-07-10 10:17:40', 'concluido', 'Assistida compareceu para atualizar endereço e tomar ciência da audiência preliminar designada nos autos n. 0053304-18.2011.8.12.0001, embargos à execução em trâmite perante a 16ª VC', 'nao', '421', '37');
INSERT INTO `assistencias` VALUES ('993', '938', '25', '25', '21', '2012-07-10 09:52:14', '2012-07-10 09:52:14', '2012-07-10 10:24:10', 'concluido', '10/07/2012 - marca audiência para dia 18/07 - 10:00 horas - sobre ocupação de imóvel da EHMA e restituição de valor de parcelas. obs. a assistida nunca teve posse do bem, nem é proprietária, existe apenas contrato compra e venda sem registro. a assistida afirmou que nunca residiu no imóvel, quem fez a benfeitoria foi a atual ocupante. ', 'nao', '942', '21');
INSERT INTO `assistencias` VALUES ('994', '935', '2', '16', '32', '2012-07-10 09:56:28', '2012-07-10 09:56:28', '2012-07-10 10:43:08', 'concluido', 'Pretende ressarcimento de valores de iptu por ele pagos em face do filho e nora. Não está com todos os recibos. Orientado a ingressar no juizado, já que terá de retornar com os demais recibos.', 'sim', '419', '32');
INSERT INTO `assistencias` VALUES ('995', '888', '20', '70', '41', '2012-07-10 10:23:14', '2012-07-10 10:23:14', '2012-07-10 11:04:22', 'concluido', 'O TJMS proferiu acórdão que julgou improcedente seu recurso de apelação. Aguardar vinda dos autos para manifestar acerca dos depósitos realizados em juízo.', 'sim', '303', '42');
INSERT INTO `assistencias` VALUES ('996', '169', '2', '25', '27', '2012-07-10 10:44:08', '2012-07-10 10:44:08', '2012-07-10 10:56:46', 'concluido', 'Atendimento DIFUSOS - Assistida apresentou-se como presidente de Associação de Amparo a Mae Precoce e Família Fragilizada que está instalada na Rua Doutor Júlio de Almeida nº235 (área invadida) e pretende propor Ação para Desapropriar a referida área. - Esclarecemos a assistida que a Desapropriação do Imóvel não pode ser promovida por particular, mas, sim, pela Administração Pública quando constadado o interesse público. - Informamos ainda que a posse durante período longo e pacífico poderia gerar aquisição da propriedade por meio de Usucapião; contudo a assistida informou que ocupam o imóvel há 03 anos e a proprietária do imóvel propos Ação de Reintegração de Posse em tramite na 6ªVara Civel.', 'nao', '', '28');
